import { Component } from "react";
const axios = require ('axios');



class Ingreso extends Component{
    Ingresar(){
        var email =document.getElementById('email').value;
        var pass= document.getElementById('pass').value; 
    
        if (email===''){
            if (pass===''){
                console.log ('Campos obligatorios')
            }
            else{
                axios.post('http://localhost:3200/api/user/login',{
                    UsEmail: document.getElementById('email').value,
                    UsPass: document.getElementById('pass').value})
            }    
        }  
    }
    

    render(){
        return(
            <div>
                <form>
                    Email: <input type='email' className="element" id='email' value='Email'></input><br/>
                    pass: <input type='password' className="element" id='pass' value='Pass'></input><br/>
                    <button className="element" onClick={Ingresar()}>Ingresar</button>
                </form>
            </div>
        )
    }
}

export default Ingreso;
